import React, { useEffect } from 'react';
import AddBtn from '../layout/AddBtn';
import Search from '../layout/Search';

const Home = () => {
  useEffect(() => {
    M.AutoInit();
  });
  return (
    <div>
      <AddBtn />
      <div className='container'>
        <Search />
        <h1>Home</h1>
      </div>
    </div>
  );
};

export default Home;
